import React from "react";
import styles from "./Products.module.css";
const Products = ({ data }) => {
  return (
    <div className={styles.container}>
      {data?.map((item) => (
        <div className={styles.card}>
          <img src={item.imageUrl} width="80px" alt="" />
          <h4>{item.name}</h4>

          <span>${item.price}</span>
        </div>
      ))}
    </div>
  );
};

export default Products;
